import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

import Views from '../views';

const Home = Views.Home();

export default function RoutesPag(){
    return(
        <React.StrictMode>
            <HeaderPag/>
            <main>
            <BrowserRouter>
                <Routes>
                    <Route path="/" element={Home}/>
                </Routes>
            </BrowserRouter>
            </main>
            <FooterPag/>

        </React.StrictMode>
    );
};
